export default function sizes(){
    const sizeList = [
        {
            name:'XS'
        },
        {
            name: 'S'
        },
        {
            name: 'M'
        },
        {
            name: 'L'
        },
        {
            name: 'XL'
        }
    ];

    return(
        sizeList.map((size, key) => 
            <div className="Sizes">
                <label>
                    <input type="checkbox">
                        <span>{size.name}</span>
                    </input>
                </label>
            </div>
        )
    );
}
